CHOOSE_GLYPHS_HELP = "На максимальном уровне вы сможете выбирать три больших и три малых символа. Большие символы меняют способ действия некоторых ваших способностей, а малые меняют визуальные эффекты и добавляют мелкие полезные качества.\n\nСимволы создаются начертателями. Прежде чем использовать тот или иной символ, его нужно купить непосредственно у другого игрока или на аукционе.\n\nВы можете отказаться от использования текущих символов, обратившись к учителю классовых навыков, или стереть конкретный символ, использовав предмет \"%s\".";
